// src/pages/SelfAssessment.js
import React from 'react';
 // Import your CSS file for styles

const SelfAssessment = () => {
  // Sample question bank data
  const questionBanks = [
    { id: 1, title: 'Question Bank 1', status: 'Completed' },
    { id: 2, title: 'Question Bank 2', status: 'In Progress' },
  ];

  const handleDownload = (id) => {
    // Handle download logic here
    alert(`Downloading question bank with id: ${id}`);
  };

  return (
    <div>
      <h2 className="centered-heading">Self Assessment</h2>
      <h3>Requested Question Banks</h3>
      <ul>
        {questionBanks.map((bank) => (
          <li key={bank.id}>
            {bank.title} - Status: {bank.status}
            <button onClick={() => handleDownload(bank.id)}>Download</button>
          </li>
        ))}
      </ul>
    </div>
  );
};

export default SelfAssessment;
